INSERT INTO `data_news` (`news_id`, `news_foto`, `news_judul`, `news_konten`, `news_date`, `is_delete`) VALUES
(1, '09102018094035news-1.jpg', 'Undangan hingga Souvenir, 10 Dekorasi Vintage Ini Bisa Dibuat Sendiri', 'Mendambakan pernikahan bertema vintage? Gak perlu pusing memikirkan dekorasinya, kamu bisa bikin sendiri dengan memanfaatkan barang-barang yang ada lho. Selain mudah dibuat, kamu juga bisa menghemat pengeluaran deh.', '2018-09-28', 0),
(2, '09102018093928news-1.jpg', '8 Inspirasi Souvenir Sederhana untuk Rustic Wedding Theme', 'Pernikahan merupakan momen sakral bagi sepasang pengantin. Berbagai persiapan mereka lakukan untuk membuat pestanya sempurna dan seindah mungkin. Salah satu tema yang belakangan ini dipilih untuk merayakan pesta pernikahan adalah rustic wedding. Konsep pernikahan ini mengusung tema \'nature\'. Biasanya dirayakan di luar ruangan dengan dekorasi berbau alam seperti, bunga-bunga liar, kayu maupun ranting, batuan dan pernak pernik berwarna pastel serta memiliki kesan jadul. Salah satu pernak pernik yang biasanya ada dalam pernikahan yaitu souvenir. Supaya para kerabat, rekan dan tamu undanganmu terkesan, berikut ini souvenir yang bisa kamu berikan di hari istimewa. Block note dilengkapi dengan pensil yang dibalut dengan warna coklat muda bisa menjadi salah satu pilihan souvenir. Block note bisa dibuat dari kertas daur ulang sehingga lebih ramah lingkungan. Simpel, bermanfaat dam ramah lingkungan. Lilin aroma terapi bisa memberikan efek rileks dengan aroma lembut seperti bunga lavender atau buah. Selain itu, bisa dimanfaatkan sebagai penerangan saat listrik padam. Satu lagi souvenir yang bisa kamu berikan, pouch. Kamu bisa membuatnya sendiri hanya dengan kain dan resleting. Bahkan, bisa memanfaatkan kain perca sebagai bahan dan dikombinasikan sesukamu. Selain pouch, kamu juga bisa membuat dompet, drawstring, tote bag maupun sling bag.', '2018-09-05', 0);
